export class AuthorizedPersonnel {
    // Basic Info
    fullName = '';
    email = '';
    phone = '';
    personalID = '';

    constructor(fullName, email, phone, personalID) {
        this.fullName = fullName;
        this.email = email;
        this.phone = phone;
        this.personalID = personalID;
    }
}
